import { Component, OnInit } from '@angular/core';
interface Product {
  id: number;
  name: string;
  quantity: number;
  status: string;
  price: number;
  category: string;
}
@Component({
  selector: 'app-qlsp',
  templateUrl: './qlsp.component.html',
  styleUrls: ['./qlsp.component.css']
})
export class QlspComponent {
  products = [
    { id: 1, name: 'Product 1', quantity: 10, status: 'In Stock', price: 100, category: 'Category 1' },
    { id: 2, name: 'Product 2', quantity: 5, status: 'Out of Stock', price: 50, category: 'Category 2' },
    { id: 3, name: 'Product 3', quantity: 2, status: 'In Stock', price: 200, category: 'Category 1' }
  ];

  addProduct() {
    // TODO: Implement add product functionality
  }

  editProduct(product: Product) {
    // TODO: Implement edit product functionality
  }

  deleteProduct(productId: string) {
    // TODO: Implement delete product functionality
  }
}
<!DOCTYPE html>
<html>
<head>
	<meta charset="utf-8">
	<meta name="viewport" content="width=device-width, initial-scale=1">
	<title></title>
  <style>
    .button-group {
			display: flex;
			justify-content: center;
			align-items: center;
			margin-bottom: 20px;
		  }

		  .button {
			display: inline-block;
			padding: 10px;
			font-size: 16px;
			background-color: #008CBA;
			color: white;
			border: none;
			text-decoration: none;
			margin-right: 10px;
			cursor: pointer;
		  }

		  .button:hover {
			background-color: #006B8F;
		  }
      .search-container {
        display: flex;
        justify-content: flex-end;
        margin-top: 20px;
      }

      input[type=text] {
        width: 250px;
        padding: 10px;
        font-size: 16px;
        border: none;
        border-bottom: 2px solid #ccc;
      }

      button[type=submit] {
        padding: 10px;
        font-size: 16px;
        background-color: #008CBA;
        color: white;
        border: none;
        cursor: pointer;
      }

      button[type=submit]:hover {
        background-color: #006B8F;
      }
      .center {
        display: flex;
        justify-content: center;
        align-items: center;
        height: 200px;
        background-color: #eee;
      }

      .center p {
        text-align: center;
        font-size: 24px;
        color: #333;
      }








      <h1>Product List</h1>
<table>
  <thead>
    <tr>
      <th>Product Code</th>
      <th>Product Name</th>
      <th>Quantity</th>
      <th>Status</th>
      <th>Price</th>
      <th>Category</th>
      <th>Actions</th>
    </tr>
  </thead>
  <tbody>
    <tr *ngFor="let product of products">
      <td>{{ product.id }}</td>
      <td>{{ product.name }}</td>
      <td>{{ product.quantity }}</td>
      <td>{{ product.status }}</td>
      <td>{{ product.price }}</td>
      <td>{{ product.category }}</td>
      <td>
        <button (click)="editProduct(product)">Edit</button>
        <button (click)="deleteProduct(product.id)">Delete</button>
      </td>
    </tr>
  </tbody>
</table>
<button (click)="addProduct()">Add Product</button>

  </style>
</head>
<body>
  <div class="button-group">
    <a routerLink="/create-supplier" class="button">Tạo mới khách hàng</a>
    <a routerLink="/create-category" class="button">Thêm danh mục</a>
    <a routerLink="/create-category" class="button">In dữ liệu</a>


  </div>
  <div class="search-container">
    <form action="/search">
      <input type="text" placeholder="Nhập từ khóa tìm kiếm" name="search">
      <button type="submit"><i class="fa fa-search"></i>Tìm Kiếm</button>
    </form>
  </div>
  <div class="center">
		<p>Quản Lý Khách Hàng</p>
	</div>
  <h2>Add New Product</h2>
<form (ngSubmit)="addProduct()">
  <div>
    <label for="productCode">Product Code:</label>
    <input id="productCode" name="productCode" [(ngModel)]="newProduct.code" required>
  </div>
  <div>
    <label for="productName">Product Name:</label>
    <input id="productName" name="productName" [(ngModel)]="newProduct.name" required>
  </div>
  <div>
    <label for="quantity">Quantity:</label>
    <input id="quantity" name="quantity" [(ngModel)]="newProduct.quantity" required>
  </div>
  <div>
    <label for="status">Status:</label>
    <select id="status" name="status" [(ngModel)]="newProduct.status" required>
      <option value="In Stock">In Stock</option>
      <option value="Out of Stock">Out of Stock</option>
    </select>
  </div>
  <div>
    <label for="price">Price:</label>
    <input id="price" name="price" [(ngModel)]="newProduct.price" required>
  </div>
  <div>
    <label for="category">Category:</label>
    <input id="category" name="category" [(ngModel)]="newProduct.category" required>
  </div>
  <button type="submit">Add Product</button>
</form>
<body>
<html>
